In C programming, there are three types of variables: local variables, static variables, and global variables.

1. Local Variables: These are declared inside a function and are only accessible within that function. They are created and destroyed each time the function is called.

2. Global Variables: These are declared outside any function and are accessible from any part of the program. They are created when the program starts and destroyed when the program ends.

3. Static Variables: These are a combination of local and global variables. They are declared inside a function but have a property similar to global variables. They are created only once when the program starts and retain their value between function calls.

Here is an example to illustrate the difference between register variables and static variables:

```c
#include <stdio.h>

void function() {
    static int staticVar = 0; // Static variable
    register int regVar;      // Register variable

    regVar = 10;
    staticVar++;

    printf("Register variable: %d\n", regVar);
    printf("Static variable: %d\n", staticVar);
}

int main() {
    function();
    function();
    function();

    return 0;
}
```

In this example, `staticVar` is a static variable and `regVar` is a register variable. The `register` keyword is used to tell the compiler to store the variable in a CPU register if possible, to improve performance. However, the number of CPU registers is limited, so not all variables can be stored in registers.

