}
```

2. Dead Code Elimination: This optimization technique removes code that is unreachable or never used. For example, in the following code, the `printf` statement is never executed because the value of `a` is always `0`.

```c
#include <stdio.h>

int main() {
    int a = 0;
    if (a == 0) {
        // This printf statement is never executed
        printf("a is zero\n");
    }
    return 0;
}
