Yes, you can write a Dynamics 365 plugin that sets a field to true if the user has a certain security role. Here's a basic example using C# and the Xrm.Sdk library:

```csharp
using System;
using System.ServiceModel;
using Microsoft.Xrm.Sdk;
using Microsoft.Xrm.Sdk.Query;

public class SetRoleFieldPlugin : IPlugin
{
    public void Execute(IServiceProvider serviceProvider)
    {
        IPluginExecutionContext context = (IPluginExecutionContext)serviceProvider.GetService(typeof(IPluginExecutionContext));
        IOrganizationServiceFactory serviceFactory = (IOrganizationServiceFactory)serviceProvider.GetService(typeof(IOrganizationServiceFactory));
        IOrganizationService service = serviceFactory.CreateOrganizationService(context.UserId);

        // Get the user's security roles
        Guid targetEntityId = context.PrimaryEntityId.Id;
        EntityCollection roles = service.RetrieveMultiple(new QueryExpression
        {
            EntityName = "systemuserroles",
            ColumnSet = new ColumnSet("roleid"),
            Criteria = new FilterExpression
            {
                Conditions =
                {
                    new ConditionExpression
                    {
                        AttributeName = "systemuserid",
                        Operator = ConditionOperator.Equal,
                        Values = { context.UserId }
                    }
                }
            }
        });

        // Check if the user has the specific role
        bool hasRole = roles.Entities.Any(r => r.GetAttributeValue<Guid>("roleid") == new Guid("YOUR_ROLE_GUID"));

        if (hasRole)
        {
            // Set the field to true
            Entity entity = service.Retrieve(context.PrimaryEntityName, targetEntityId, new ColumnSet("field_name"));
            entity["field_name"] = true;
            service.Update(entity);
        }
    }
}
```

In this example, replace `"YOUR_ROLE_GUID"` with the GUID of the security role you're checking for. Also, replace `"field_name"` with the name of the field you want to set to true.

